ot responsible for any injury or harm might occur while exercising or performing inappropriate exercises.\nFitness Storm is targeting the individuals healthy enough to perform different types of exercises. In case you suffer from any injuries or specific health conditions, make sure to consult your physician before registering in our application.\nIf you are pregnant or breastfeeding, make sure that your doctor has specifically approved your use of the application.\n\nTerms and conditions for personal training:\nThe personal training sessions cannot be refunded, and the start and end dates of the sessions must be adhered to\n-Unforeseen circumstances may arise that result in rescheduling sessions, in which case the following policy will apply:\n- If you are forced to cancel the session within 24 days from the date of booking, the session will be compensated for free.\n- In case of canceling the session on the same day, the session will be deducted from the remaining sessions.\n-Personal training sessions are subject to an expiration period of 30 days from the date of participation.\n-The duration of the session is between 45 Mins to one hour\n-The session cannot be recorded via video, as it is subject to confidentiality between the trainer and the trainee.\n-Numbers/emails cannot be exchanged between the trainer and the trainee, and the service is provided through Fitness Storm.\n-Postponement is two sessions per month.\n-The postponement must be notified at least one day before the session, otherwise the session will be considered cancelled.\n-A date must be set to compensate for the postponed session within a week starting from the day of the postponement, or the session is considered cancelled.\n\n\nPayment processing\nWe accept payments_cubit through the available options in the application in SAR or USD. \n\nPayment confirmation\nOnce the payment is made, the confirmation notice will be sent to the client via email within 24 hours of receipt of payment.\n\nGoverning Law and Jurisdiction\nAny purchase, dispute or claim arising out of or in connection with this application shall be governed and construed in accordance with the laws of Saudi Arabia.\nThe application Policies and Terms & Conditions may be changed or updated occasionally to meet the requirements and standards. Therefore, the Customers are encouraged to frequently visit these sections in order to be updated about the changes on the application. Modifications will be effective on the day they are posted."),
